column8:
【メーカー希望小売価格について】</br>
メーカー希望小売価格はメーカーサイトに基づいて掲載しています。</br>
リンク１</br>
※商品はゆうメールでの発送となります。<br>
日時指定は不可となります。<br>
コンビニ受取を選択の場合は別途送料がかかりますのでご了承ください！<Br>
代引きを選択の場合は+600円の送料となります。<br>
ゆうメールでの発送の為、他商品との同梱は不可となります。<br>
ホタテ100%でできた新しい抗菌消臭剤スカロー<br>
足のにおいが気になり始めるこの季節に<br>
オススメなのが、有名な商品にも負けない<br>
ホタテでできた消臭剤スカローです！<br>
<br>
なんといってもその魅力は天然素材100%の安心さと<br>
レビューを見ればわかるその確実さです！<br>
お値段も有名商品と比べてもお買い得ですので、<br>
ぜひ一度お試しいただければと思います！<br>
もちろん、小さなお子さんやペット、<br>肌の弱い方や香水などのニオイが気になる方への心配も一切ありません！<br>

<TABLE border="1" cellspacing="0" cellpadding="25" >    <TR>      <TD valign="top"><FONT size="2">【スカローの主な使用例】<BR>      ■野菜のつけおき洗い<BR>      ■消臭スプレーとしてタバコ臭、ペット臭、トイレ、生ごみ臭、車内のにおいに。<BR>      ■ビジネスシューズ 靴 シューズ 運動靴 スニーカー 安全靴 靴下 等の消臭・防臭。粉末のまま靴に振りかけてください。<BR>      ■洗濯槽の洗浄<BR>      ■まな板・食器・トレー弁当箱・三角コーナー水切り袋などの除菌・抗菌<BR>      ■カット野菜・果物の鮮度保持、洗浄。一般的には次亜塩素酸ナトリウムが使用されますが、この薬品は人体や水質環境への影響が懸念されています。<BR>      ■排水溝口や排水パイプのぬめりとり。スカロー水溶液をそのまま排水口へお流しください。<BR>      ■土壌改良（酸性土壌⇒アルカリ性土壌）<BR>      ■農作物の育成促進<BR>      ■切り花の延命効果<BR>      ■家畜の発育促進<BR>      ■鮮魚の鮮度保持<BR>      ■洗濯洗剤への添加<BR>          <BR>      <BR>      【使用上の注意】<BR>■スカローは強アルカリ性の為濡れた手で直接触れないで下さい。肌が荒れる場<BR>合があります。<BR>■スカロー・スカロー水溶液が目に入った場合は、すばやくきれいな水で洗浄して<BR>下さい。<BR>■誤って飲んでしまった場合は、大量の水を飲んで下さい。<BR>■身体に不具合が出た場合は医師にご相談下さい。<BR>■お子様の手の届かない場所に保管して下さい。<BR>■開封後（使用後）は密閉しなるべく空気に触れないようにして下さい。<BR>■微粉末のため、取り扱い時にはマスク等をご使用下さい。<BR>  【インソール 中敷き 蒸れ 対策 強烈 梅雨】    </FONT></TD>    </TR></TABLE><style type="text/css">
